                <DialogItem name='Max' id='6'/>
            </div>
            <div className={classes.messages}>
                <Message message='Oi!' />
                <Message message='How is it going?' />
                <Message message='Check out my new project on git!' />
                <Message message='I need a job so bad!' />
                <Message message='Going crazy..' />
            </div>
        </div>
    )
}



export default Dialogs;
